import express from 'express';
import bodyJson from 'body-parser';
import commentRoute from './comments';

let store = {
    posts: [
        {
            name: 'Top 10 ES6 Features every Web Developer must know',
            url: 'https://webapplog.com/es6',
            text: 'This essay will give you a quick introduction to ES6. If you dont know what is ES6, its a new JavaScript implementation.',
            comments: [
                { text: 'Cruel..var { house, mouse} = No type optimization at all' },
                { text: 'I think youre undervaluing the benefit of let and const.' },
                { text: '(p1,p2)=>{  } ,i understand this ,thank you !' }
            ]
        }
    ]
}

let postRoute = express.Router();

postRoute.use(bodyJson.json());
postRoute.use((req, res, next) => {
    req.store = store;
    next();
})

postRoute.use('/:postId/comments', (req, res, next) => {
    req.postId = req.params.postId;
    next();
    //is this middleware neccessary???
})
