import express from 'express';
import bodyJson from 'body-parser';

let commentRotue = express.Router();
commentRotue.use(bodyJson.json());

commentRotue.get('/', (req, res, next) => {
    res.status(200);
    res.send(req.store.posts[req.postId].comments);
})

